import React from 'react';
import {BrowserRouter as Router, Switch,Route} from 'react-router-dom';

const Rightfinder = () => {
    return(
        <Router>
             <div className='rightFinder'>
                <Switch>
                    <Route></Route>
                </Switch>
            </div>
        </Router> 
    )
}

export default Rightfinder;
